import React from 'react';

export default function MessageBox(props) {
  const { variant } = this.props;
  return (
    <React.Fragment>
      <div>
        {props.children}
        {}
      </div>
      <div className={`alert alert-${variant || 'info'}`}>{props.children}</div>
    </React.Fragment>
  );
}
